import './styles.css';


function Hero() {
  return (
      
    <div class="hero overlay" id = "home">
        <div class="hero-container">
            <h1 class="hero-heading">Raritan Valley Regional <span>EMS</span></h1>
            <p class="hero-description">Non-Profit Organizaition</p>
        </div>
    </div>
  );
}

export default Hero;
